let articles = {"Damage Type":[["Attack-damage",false,"This term refers to Damage dealt from attacks launched by the Team Members in the Round.<br>This term includes damage dealt from Afterattack."],["Direct Damage",false,"This term is also known as Active Skill Damage.<br>This term refers to Damage dealt from Skill which includes Active Skill, Leader Skill, Team Skill, and Craft Apparatus Ability.<br>Common property of this Damage is that it reveals invisible enemies, unaffected by Defensive Shield, and disregards All-Runestone Shield (Type)."],["Depletion",false,"This term refers to Damage dealt to enemies by reducing percentage of their HP.<br>Depletion Damage disregard all Boss Skills unless being specified the opposite.<br>When Depletion takes place, the Boss Skill [Mutual Depletion] also takes place."],["Damage Disregarding Boss Skill",false,"This term refers to Damage of fixed amount that completely disregard all Boss Skills.<br>This type of Damage is often unaffected by other factors that it cannot be increased nor decreased."]],"Gameplay Mechanic":[["Core Gameplay",true,""],["Moving Runestones",false,"Runestone movement is started when a Runestone you hold is moved to touch other Runestone. When that happens, both Runestones swap place.<br>This swapping is counted as a <b>step.</b>"],["Dissolving Runestones",false,"When Runestone movement ends, the game will immediately start scanning the board and dissolve Runestone link(s) that fit the dissolving criteria. This process runs until no Runestone to be dissolved is found."],["Launch Attack",false,"Immediately after dissolving Runestones, the game will calculate input gained from the dissolved Runestones as Attack value of each Member.<br>A Member will launch an attack if their resulting Attack value is not 0. Damage caused from each Member is refered to as <b>Attack-damage</b>."],["Recover HP",false,"Immediately after dissolving Runestones, the game will calculate input gained from the dissolved Heart Runestones as HP recovery.<br>The base recovery sums the Recovery value of each Member."],["Skill Activation",false,"Before Runestone movement, you can tap on the icon of a Member whose Skill CD is 0 and activate its Skill. Doing so will perform a variety of effects in gameplay, such as increasing attack output or generate Runestones of certain type.<br>Skill(s) of Characters with Skill EP can be activated as long as their Skill EP above the required EP cost."],["Snipe",false,"Directly damage the enemy outside of Attack-damage, usually by activating Skill."],["Afterattack",false,"When enabled, for example from Active Skill, one or more assigned Members will launch additional extra attack(s) after all Member launched an attack.<br>Afterattack will still be launched even if the assigned Members cannot launch an attack by any means."],["Recovery Surplus Attack",false,"When enabled, for example from Active Skill, an Attack will be launched whenever HP Recovery happens and it results in overhealing.<br>The base value of Recovery Surplus Attack is the difference between the Recovery value and lost HP value."]]};
